import styled from "styled-components";
import React from "react";

const Button = ({ size }) => {
  return <Button size={size}></Button>;
};

export default Button;

const ButtonSt = styled.button`
  font-weight: bold;
  color: #7c009b;
  border: 1px solid transparent;
  border-radius: 10px;
  background-color: transparent;
  width: ${({ size }) => `${size}px`};
  height: 35px;
  margin: 10px;
  cursor: pointer;
  box-shadow: 0px 0px 3px 0px #7c009b;
  &:hover {
    color: white;
    border: 1px solid white;
  }
`;

// const로만 선언해준 후 export해도됨 -> export { CarouselContainer, StyledComponent }
